var {spawn: spawn2 } = globalThis.Bun;
import { readdir, stat } from "fs/promises";
import { join } from "path";
import { homedir } from "os";
var LEROBOT_CACHE_DIR = join(homedir(), ".cache", "huggingface", "lerobot");
async function listLocalDatasets() {
  try {
    const datasets = [];
    try {
      await stat(LEROBOT_CACHE_DIR);
    } catch {
      return { datasets: [] };
    }
    const entries = await readdir(LEROBOT_CACHE_DIR, { withFileTypes: true });
    for (const entry of entries) {
      if (!entry.isDirectory())
        continue;
      const orgPath = join(LEROBOT_CACHE_DIR, entry.name);
      const orgEntries = await readdir(orgPath, { withFileTypes: true });
      for (const repoEntry of orgEntries) {
        if (!repoEntry.isDirectory())
          continue;
        const repoId = `${entry.name}/${repoEntry.name}`;
        const repoPath = join(orgPath, repoEntry.name);
        const info = await getDatasetInfoFromPath(repoPath, repoId);
        if (info) {
          datasets.push(info);
        }
      }
    }
    return { datasets };
  } catch (error) {
    return {
      datasets: [],
      error: error instanceof Error ? error.message : String(error)
    };
  }
}
async function getDatasetInfoFromPath(path2, repoId) {
  try {
    const metaPath = join(path2, "meta.json");
    const infoPath = join(path2, "info.json");
    let metadata = null;
    try {
      const metaContent = await Bun.file(metaPath).text();
      metadata = JSON.parse(metaContent);
    } catch {
      try {
        const infoContent = await Bun.file(infoPath).text();
        metadata = JSON.parse(infoContent);
      } catch {}
    }
    let numEpisodes = 0;
    try {
      const dataPath = join(path2, "data");
      const dataEntries = await readdir(dataPath);
      numEpisodes = dataEntries.filter((e) => e.startsWith("episode_") || e.endsWith(".parquet")).length;
    } catch {}
    return {
      repoId,
      fps: metadata?.fps || 30,
      numEpisodes,
      numFrames: metadata?.total_frames || 0,
      robotType: metadata?.robot_type,
      features: metadata?.features || []
    };
  } catch {
    return null;
  }
}
