function buildRecordCommand(config) {
  const args = [
    "lerobot-record",
    "--robot.type",
    config.robotType,
    "--robot.port",
    config.robotPort,
    "--dataset.repo_id",
    config.repoId,
    "--dataset.fps",
    String(config.fps),
    "--dataset.episode_time_s",
    String(config.episodeDurationS),
    "--dataset.reset_time_s",
    String(config.resetTimeS),
    "--dataset.num_episodes",
    String(config.numEpisodes)
  ];
  if (config.teleopType) {
    args.push("--teleop.type", config.teleopType);
    if (config.teleopPort) {
      args.push("--teleop.port", config.teleopPort);
    }
  }
  if (config.taskDescription) {
    args.push("--dataset.task", config.taskDescription);
  }
  config.cameras.forEach((camera, index) => {
    const prefix = `--robot.cameras.cam_${index}`;
    args.push(`${prefix}.type`, camera.type);
    args.push(`${prefix}.index`, String(camera.indexOrPath));
    args.push(`${prefix}.width`, String(camera.width));
    args.push(`${prefix}.height`, String(camera.height));
    args.push(`${prefix}.fps`, String(camera.fps));
  });
  if (config.pushToHub) {
    args.push("--dataset.push_to_hub", "true");
  }
  if (config.resume) {
    args.push("--resume", "true");
  }
  return args;
}
async function recordEpisode(config, onOutput) {
  const args = buildRecordCommand(config);
  try {
    const proc = spawn3({
      cmd: args,
      stdout: "pipe",
      stderr: "pipe"
    });
    const stdoutPromise = new Response(proc.stdout).text();
    const stderrPromise = new Response(proc.stderr).text();
    if (onOutput) {
      const decoder = new TextDecoder;
      const reader = proc.stdout.getReader();
      (async () => {
        try {
          while (true) {
            const { done, value } = await reader.read();
            if (done)
              break;
            const text = decoder.decode(value);
            text.split(`
`).filter((l) => l.trim()).forEach(onOutput);
          }
        } catch {}
      })();
    }
    const [stdout, stderr] = await Promise.all([stdoutPromise, stderrPromise]);
    const exitCode = await proc.exited;
    return {
      success: exitCode === 0,
      output: stdout + stderr,
      error: exitCode !== 0 ? `Process exited with code ${exitCode}` : undefined
    };
  } catch (error) {
    return {
      success: false,
      output: "",
      error: error instanceof Error ? error.message : String(error)
    };
  }
}
